import React from 'react';
import './App.css';
import Cards from './Components/Cards';
import Navs from './Components/Navs';
import LeftNav from './Components/LeftNav';
import Banner from './Components/Banner';

import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <Navs />
      <div class="container">
        <Switch>
        <div class="row">
          {/* <!-- Left Side --> */}
          <LeftNav />

          {/* <!-- Right Side --> */}
          <div class="col-lg-9">
            {/* Top right side */}
            <Banner />

            {/* Bottom right side */}
            <Cards />
          </div>
        </div>
        {/* <!-- End of Right Side --> */}
        </Switch>
      </div>
      {/* <!-- End of Row --> */}

    </div>
    </Router>
  );
}

export default App;
